import React, {Component} from "react";
import "./App.css";

export default class App extends Component {
  render() {
    return(
      <div className="container">
        <div className="todoBlock">
          <div className="title">
            할 일 목록
          </div>
          <div>
            <input type="checkbox" defaultChecked={false} />
            폼롤러 스트레칭
            <button style={this.btnStyle}>x</button>
          </div>
        </div>
      </div>
    )
  }
}
